import React from 'react';
import './App.css';

class App extends Component {
  render(){
    return(
      <div className="App">
        <div className="calc-wrapper">
          <div className="row">
            <button>7</button>
            <button>8</button>
            <button>9</button>
            <button>/</button>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
